syntax = "proto3";

package domain;

message FlowMarkerItem {
  string objectId = 1;
  string flowMarkerId = 2;
  string reportNo = 3;
  string name = 4;
  string percentage = 5;
  string intensity = 6;
  bool report = 7;
  bool markerUsed = 8;
  string markerType = 9;
  string interpretation = 10;
  bool predictive = 11;
  int32 expresses = 12;
  int32 orderFlag = 13;
  string result = 14;
  int32 cellPopulationId = 15;
  string cellPopulationOfInterest = 16;
  string panelName = 17;
}
